  //     // capabilities for local Appium web tests on an Android Emulator
  //     platformName: 'Android', // or "iOS"
  //     'appium:deviceName': 'Pixel 4a', // or "iPhone Simulator"
  //     'appium:platformVersion': '11.0', // or "16.2" (for running iOS v16)
  //     'appium:automationName': 'UiAutomator2', // or "XCUITest"
  //     'appium:app': join(process.cwd(),'./app/android/ColorNote+Notepad.apk'),
